  { path: "/", element: <TopPage /> },
  { path: "/products", element: <Products /> },
]);

function App() {
  return (
    <>
      <nav>
        <h1>here is about header</h1>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/products">products</Link>
          </li>
        </ul>
      </nav>
      <h1>dsdsd</h1>
      {/* <NavigateBar /> */}
      <RouterProvider router={routes} />
    </>
  );
}

export default App;
